pragma solidity ^0.5.0;

contract Bank {
  mapping(address => uint256) public accounts2;

    constructor() public {}

	function totalAssets() view external returns(uint256) {
		return address(this).balance;
	}

	function deposit() payable external {
		require(msg.value > 0, "Must deposit more than 0 ETH");
		accounts2[msg.sender] += msg.value;
	}

	function withdraw(uint256 _amount)  external {
		require(_amount <= accounts2[msg.sender], "Cannot withdraw more than deposited");

		accounts2[msg.sender] -= _amount;
		address(msg.sender).transfer(_amount);
	}
}
